div.script:
$('#_inputAddress').keypress(function (e) {
    if (e.which == 13) {
        e.preventDefault();
        $('#ctl00_ContentBody_LocationPanel1_btnLocale').click();
    }
});
$('#ctl00_ContentBody_LocationPanel1_btnLocale').click(function () {
    //showModalSpinner();
    var searchType = $('#ctl00_ContentBody_LocationPanel1_ddSearchType').val();
    if (searchType == "ZIP") {
        var excludeUserFinds = 0;
        if ($('#ctl00_ContentBody_ChkExclude').prop("checked") == true) {
            excludeUserFinds = 1;
        }
        var taxonomyFilter = $("#ctl00_ContentBody_uxTaxonomies :selected");
        if (taxonomyFilter != null)
            $('#ctl00_ContentBody_LocationPanel1_OriginText').searchByAddress(
                'ctl00_ContentBody_LocationPanel1_OriginText',
                {
                    'cFilter': taxonomyFilter.val(),
                    'onNoneFound': hideModalSpinner,
                    'excludeUserFinds': excludeUserFinds,
                    'includeChildren': (taxonomyFilter.attr("searchType") != undefined && taxonomyFilter.attr("searchType") == 'All') ? "y" : "n"
                });
        else
            $('#ctl00_ContentBody_LocationPanel1_OriginText').searchByAddress(
                'ctl00_ContentBody_LocationPanel1_OriginText',
                {
                    'excludeUserFinds': excludeUserFinds
                });
        return false;
    } else if (searchType == "WPT") {
        var searchValue = $('#_inputAddress').val();
        if (searchValue == undefined) return;
        var searchBaseUrl = '/seek/nearest.aspx';
        if (searchValue == null || $.trim(searchValue).length == 0) {
            alert("A location for '" + searchValue + "' could not be determined");
            return;
        }
        $('#ctl00_ContentBody_LocationPanel1_btnLocale').attr("disabled", true);
        var excludeUserFinds = "";
        if ($('#ctl00_ContentBody_ChkExclude').prop("checked") == true) {
            excludeUserFinds = "&f=1";
        }
        var taxonomyFilter = $("#ctl00_ContentBody_uxTaxonomies :selected");
        taxonomyFilter = taxonomyFilter != null ? '&cFilter=' + taxonomyFilter.val() : '';
        jQuery.getJSON(
            "/api/geocode",
            { q: searchValue },
            function (response) {
                if (response.status == "success") {
                    var url = [searchBaseUrl, '?lat=', response.data.lat, '&lng=', response.data.lng, '&dist=25', excludeUserFinds, taxonomyFilter].join('');
                    $('#ctl00_ContentBody_LocationPanel1_btnLocale').attr("disabled", false);
                    setTimeout(function () {
                        window.location.assign(url);
                    }, 0);
                } else {
                    $('#ctl00_ContentBody_LocationPanel1_btnLocale').attr("disabled", false);
                    alert("Sorry, I was unable to determine a location for " + searchValue);
                }
            });
        return false;
    }
});
